import { useRouter } from 'next/router'
import SearchWord from '../../../components/SearchWord'

const dictionary = () => {
    const router = useRouter()
    const { movieId } = router.query
    return (
        <div>
            {movieId}<vr/>
            <SearchWord/>
            <p>Hello dictionary!!!</p>
        </div>
    )
}

export default dictionary
